	                                        React.createElement("p", null, "Around 600 million years old, and a canvas painted with the rich diversity of the Cape floral kingdom, Table Mountain is truly iconic. You can admire the showstopper of Table Mountain National Park and one of the 'New Seven Wonders of Nature' (www.new7wonders.com) from multiple angles, but you really can't say you've visited Cape Town until you've stood on top of it.")
